import { PHONES_LOADED } from 'actionTypes'


const initialState = {
  phones: []
}

export default (state = initialState, { type, payload }) => { 
  // console.log('reduserPay = ', payload)  
  switch (type) {
    case PHONES_LOADED:
      return {
        ...state,
        phones: payload,
        // loading: false,
        // error: null
      }
    
  default:  
    return state
  }; 

}